  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112354 includes biological,
  chemical, discrete sample, meteorological, physical and profile data collected from
  MIRAI in the North Pacific Ocean and South Pacific Ocean from 2002-01-07 to 2002-02-16
  and retrieved during cruise MR02-K01 and PACIFICA_49NZ20020107. These data include
  AMMONIUM, CHLOROPHYLL, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  Extinction coefficient of the atmosphere, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY, SIGMA-T,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Takeshi
  Kawano of Japan Agency for Marine-Earth Science and Technology (Jamstec) and Masao
  Ishii of Meteorological Research Institute; Geochemical Research Department as part
  of the PACIFICA_49NZ20020107 data set.nnPACIFICA (PACIFic ocean Interior CArbon)
  was an international collaborative project for the data synthesis of ocean interior
  carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
  Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
  project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
